import styled from "styled-components";
import { animated, useSpring } from "react-spring";
import { withProps } from "../util";

const Modal = ({ pos, backdrop, ...props }) => {
  switch (pos) {
    case "left":
      return withProps(Model_Left, props);
  }
};

const Model_Left = styled.div`
  height: 100%;
  width: 30vw;
`;

export default Modal;
